  \"2016-07-27T22:42:22.354887\",\n\t\"name\": \"survey-for-contaminants-in-sediments-and-fish-at-selected-sites-on-the-illinois-river-and-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A basin-wide survey of contaminants in
  sediments and biota at several locations on the Illinois River and selected tributaries
  was conducted during the 1989 field season. The study area along the Illinois River
  extended from the Chicago, Illinois area, down river to the Grafton, Illinois area.
  Bottom sediments and fish were collected at pre-designated sampling locations. Chemical
  analysis, aquatic bioassays, and Microtox assays were performed on samples from
  each location. The results indicate that there are several critical areas of concern
  throughout the upper and mid-portions of the Illinois River.\",\n\t\"license_title\":
